import React from 'react';

const Login = () => {
    return (
        <div>
            <h1>Se connecter</h1>
            <div className='login_form'>
                <ul>
                    <li><form action="#">
                        <label htmlFor="Mail"></label>
                        <input type="text" className='mail'
                        value='Adresse mail' onFocus="this.value'';" />
                        </form>
                    </li>
                    <li><form action="#">
                        <label htmlFor="Mot de passe"></label>
                        <input type="text" className='mot_de_passe'
                        value='Mot de passe' onFocus="this.value'';" />
                        </form>
                    </li>
                </ul>
            </div>
        </div>
    );
};

export default Login;
